def insercao(lista):
    
    for i in range(1, len(lista)):
        n = 0
        for j in range(1, i + 1):
            if lista[i] < lista[i - j]:
                n += 1
                
        if n > 0:
            temp = lista[i]
            lista[i-n +1: i +1] = lista[i-n: i]
            lista[i-n] = temp

